SQL_STMT_U.val:
select t.tr_transnummer "Nummer" , t.tr_transdatum "datum" , t.tr_indicatie "Indi" , ltrim(ltrim(trim(o.to_omschrijving1)||' ')||trim(o.to_omschrijving2)||' '||trim(o.to_omschrijving3)) "Oms" , t.tr_herkomst_code_tr "Herkomst" , t.tr_mutatiecode "Mutatie" , t.TR_PROVISIE , b.be_oms_1 "Instrument" , t.tr_be_muntsoort "Munt" , t.tr_be_munt_krs "ValutaKoers" , t.TR_MUT_KOSTEN_PLUS_BTW + t.Tr_Transferprov + t.Tr_Chequekosten + t.TR_RESTITUTIEPROVISI + t.TR_REALLOWANCE + t.TR_SETTLEMENT_KOSTEN + t.TR_PROVISIEKORTING + t.TR_BELASTFYSLEV_KB + t.tr_kostenbet_verk + t.tr_overige_kosten + t.TR_DEP_RENTE_INFO + t.TR_COURTAGE "Overig" , t.TR_KOSTEN , t.TR_BELASTING , t.tr_volgnummer "Vlgnr" , t.tr_rel1 , t.tr_trans_munts , t.tr_trans_munts_krs , t.tr_trans_munts_fac , t.tr_trans_munts_rcp , decode (r.re_nummer - t.tr_rel1, 0, t.tr_rel1_rap_munts, t.tr_rel2_rap_munts) rap_munt , decode (r.re_nummer - t.tr_rel1, 0, t.tr_rel1_rap_krs, t.tr_rel2_rap_krs) rap_krs , decode (r.re_nummer - t.tr_rel1, 0, t.tr_rel1_rap_fac, t.tr_rel2_rap_fac) rap_fac , decode (r.re_nummer - t.tr_rel1, 0, t.tr_rel1_rap_rcp, t.tr_rel2_rap_rcp) rap_rcp , t.tr_mut_gemaakt , t.tr_context_enum
from TRANSAKTIES t inner join TRANS_OMSCHRIJVING o on o.to_transactievolgnr = t.tr_volgnummer inner join BELEGGINGSINSTRUMENT b on b.be_symbool = t.tr_symbool and b.be_optietype = t.tr_optietype and b.be_expiratiedatum = t.tr_expiratiedatum and b.be_exerciseprijs = t.tr_exerciseprijs inner join TRANSACTIESOORTEN ts on ts.ts_symbool=t.tr_indicatie inner join qrap_header q on q.id = ~1 inner join rekeningen r on r.re_id = q.security_re_id where t.tr_volgnummer in ( select ti.trai_tr_volgnummer from tap_tr_rel_account_info ti inner join transactions t2 on t2.tr_volgnummer = ti.trai_tr_volgnummer inner join rekeningen r2 on r2.re_id = ti.trai_tr_re_id inner join rekeningen_per_product rp on rp.rpp_relatienummer = r2.re_nummer and rp.rpp_rekening_nummer = r2.re_rekening and rp.rpp_rekeningsoort = r2.re_soort and rp.rpp_valuta = r2.re_muntsoort inner join producten_per_relatie pr on pr.ppr_relatienummer = r2.re_nummer and pr.ppr_productnummer = rp.rpp_productnummer and pr.ppr_volgnr_per_product = rp.rpp_volgnr_per_product and pr.ppr_id = ~2 where ti.trai_tr_account_code in (1,2,3,4) and ((t2.tr_mut_gemaakt='J' and t2.tr_transdatum between ~3 and ~4) or (t2.tr_mut_gemaakt in ('s','S') and t2.tr_boekdatum between ~3 and ~4 and t2.tr_transdatum < ~3))
) order by t.tr_transdatum, t.tr_indicatie, b.be_oms_1, t.tr_transnummer
